import React, { Component } from "react";
import Select from "@material-ui/core/Select";
import MenuItem from "@material-ui/core/MenuItem";
import IntlMessages from "../../../../../util/IntlMessages";
import TextField from "@material-ui/core/TextField";
import InputLabel from "@material-ui/core/InputLabel";
import { makeStyles } from "@material-ui/core/styles";
import { Form, FormGroup, Label, Input, FormText, Row, Col } from "reactstrap";
import CardBox from "../../../../../components/CardBox/index";
import ServiceItemList from "./ServiceItemList";
import { ListItem } from "@material-ui/core";
import TablePagination from "@material-ui/core/TablePagination";
import { connect } from "react-redux";

export class ListServiceAllocation extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }
  componentDidMount() {}

  render() {
    return (
      <CardBox styleName="text-black col-lg-12">
        <div className="row d-flex justify-content-center alignement-items-center">
          {this.props.allocationService.map((element) => (
            <ServiceItemList
              key={element.id}
              item={element}
              languageId={this.props.settings.languageId}
              idEstablishment={this.props.userProfile.establishment_id}
              users={this.props.users}
            />
          ))}
        </div>
      </CardBox>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    userProfile: state.auth.userProfile,
    settings: state.settings.locale,
    users: state.stuppUsers.remoteStuppUsers,
  };
};
export default connect(mapStateToProps)(ListServiceAllocation);
